    position: absolute
}

@media (min-width:750px) {
    .Header-figure {
        box-shadow: none;
        float: right;
        margin-bottom: -220px;
        margin-right: calc(50% - 50vw);
        min-height: 460px;
        padding: 0 0 32%;
        position: static;
        width: calc(20% + 50vw)
    }
    .Header-scrollIndicator {
        display: block
    }
    .Header-block {
        margin: 40px 0 -50px;
        padding: 4.15% 8.3%
    }
    .Header-carousel,
    .Header-photo {
        margin: 40px -.5rem -90px
    }
    .Header-carouselInfo {
        left: 8.3%;
        right: 8.3%
    }
    .Header-carouselBreadcrumb {
        display: inline-block
    }
}

@media (min-width:950px) {
    .Header-figure {
        width: calc(30% + 50vw)
    }
    .Header-carouselDescription {
        max-width: 350px
    }
    .Header--team-member div.Header-carouselDescription {
        max-width: unset
    }
    .Header-block {
        margin-bottom: -8.3%
    }
}

.Theme--base .Header-bg,
.Theme--resources .Header-bg {
    background-color: #3ecc77
}

.Theme--home .Header-bg,
.Theme--classes .Header-bg,
.Theme--class-application .Header-bg,
.Theme--apply .Header-bg,
.Theme--teammembers .Header-bg {
    background-color: #f66533
}

.Theme--directory .Header-bg,
.Theme--404 .Header-bg,
.Theme--diversity-inclusion .Header-bg,
.Theme--about .Header-bg,
.Theme--contact-us .Header-bg {
    background-color: #f24034
}

.Theme--articles .Header-bg,
.Theme--events .Header-bg,
.Theme--news .Header-bg,
.Theme--press-new .Header-bg {
    background-color: #3e6682
}

.Theme--programs .Header-bg,
.Theme--program-collections .Header-bg {
    background-color: #ffab40
}

.Theme--field-notes .Header-bg {
    background-color: #6cbee3
}

.Theme--resources .Header-scrollIndicator,
.Theme--articles .Header-scrollIndicator,
.Theme--press-new .Header-scrollIndicator,
.Header--team-member .Header-scrollIndicator {
    color: #323232
}

.Theme--directory .Header-bg {
    background: transparent;
    height: 1000px
}

.Theme--directory .Header-description {
    color: #f24034
}

.Header--home .Header-figure,
.Header--404 .Header-figure {
    display: none
}

.Header--home .Header-bg,
.Header--404 .Header-bg {
    background: transparent;
    height: 1000px
}

.Header--home .Header-description,
.Header--404 .Header-description {
    color: #f24034;
    margin: 30vh 0;
    max-width: none;
    text-align: center
}

@media (min-width:750px) {
    .Header--home .Header-description,
    .Header--404 .Header-description {
        margin: 25vh 0
    }
}

@media (min-width:1200px) {
    .Header--home .Header-description,
    .Header--404 .Header-description {
        margin: 20vh 0
    }
}

.Header--home .Header-scrollIndicator {
    color: #f24034;
    left: auto;
    margin: 0 auto;
    position: relative;
    width: 1px
}

.Header--home .Header-scrollIndicator span {
    color: #323232;
    font-size: 12px;
    font-weight: 700;
    left: -150px;
    position: absolute;
    right: -150px;
    text-align: center;
    text-transform: uppercase;
    top: -30px
}

.Header--home .DirectionalArrow {
    height: 40px
}

.Header--404 .Header-scrollIndicator {
    display: none
}

.Header--article {
    margin-bottom: 2em
}

.Header--article .Header-bg::after {
    background: rgba(50, 50, 50, .4);
    content: '';
    display: block;
    height: 100%;
    position: absolute;
    width: 100%
}

.Header--article .Header-description {
    color: #fff048
}

@media (min-width:950px) {
    .Header--article {
        margin-bottom: 6em
    }
    .Header--article .Header-description {
        margin-left: 12.5%
    }
}

.Header--article .Header-description p::after {
    content: '\00a0—'
}

.Header--article .Header-scrollIndicator {
    color: #ff4337
}

@media (min-width:750px) {
    .Header--abbreviated.Header {
        margin-bottom: 0
    }
}

.Header--abbreviated .Header-figure {
    display: none
}

.Header {
    margin-bottom: 5.5rem
}

.Header+.Main .QuickNav {
    margin-bottom: 8rem
}

.Header--page+.Main .QuickNav {
    display: none
}

.Header--plain {
    margin-bottom: 0
}

.Header--plain .Header-scrollIndicator {
    color: #323232
}

@media (min-width:750px) {
    .Header {
        margin-bottom: 20rem
    }
    .Header-top {
        padding: 40px 20px 0
    }
    .Header+.Main .QuickNav {
        margin-bottom: 23rem
    }
    .Header--team-member {
        margin-bottom: 6rem
    }
    .Header--article {
        margin-bottom: 5.5rem
    }
    .Header--page {
        margin-bottom: 10rem
    }
    .Header--plain {
        margin-bottom: 8rem
    }
    .Header--page+.Main .QuickNav {
        display: block;
        margin-bottom: 13rem
    }
}
